import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createTabOne(
  hour: string,
  cars: number,
  trucknbus: number,
) {
  return { hour, cars, trucknbus};
}

const rows = [
  createTabOne('00:00', 0.58, 6.0),
  createTabOne('01:00', 0.19, 9.0),
  createTabOne('02:00', 0.44, 16.0),
  createTabOne('03:00', 0, 3.7),
  createTabOne('04:00', 0.14, 16.0),
  createTabOne('05:00', 0.51, 16.0),
  createTabOne('06:00', 2.33, 16.0),
  createTabOne('07:00', 5.31, 16.0),
  createTabOne('08:00', 5.9, 16.0),
  createTabOne('09:00', 4.88, 16.0),
  createTabOne('10:00', 5.46, 16.0),
  createTabOne('11:00', 4.44, 16.0),
  createTabOne('12:00', 4.22, 16.0),
  createTabOne('13:00', 6.19, 16.0),
  createTabOne('14:00', 6.91, 16.0),
  createTabOne('15:00', 8.15, 16.0),
  createTabOne('16:00', 7.79, 16.0),
  createTabOne('17:00', 9.97, 16.0),
  createTabOne('18:00', 7.21, 16.0),
  createTabOne('19:00', 6.91, 16.0),
  createTabOne('20:00', 5.02, 16.0),
  createTabOne('21:00', 3.78, 16.0),
  createTabOne('22:00', 2.33, 16.0),
  createTabOne('23:00', 1.24, 16.0),
];

export default function DenseTable() {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ maxWidth: 300 }} size="small">
        <TableHead>
          <TableRow>
            <TableCell >Hora</TableCell>
            <TableCell >Autos</TableCell>
            <TableCell >Camiones/Ã“mnibus</TableCell>
          </TableRow>
        </TableHead>
        <TableBody >
          {rows.map((row) => (
            <TableRow
              key={row.hour}
              sx={{ '&:last-child td, &:last-child th': { border: 0 }}}
            >
              <TableCell align="center" component="th" scope="row">
                {row.hour}
              </TableCell>
              <TableCell align="center">{row.cars}</TableCell>
              <TableCell align="center">{row.trucknbus}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
